# filename: conf.sh
echo "\$0: $0"

# get macOS version
sw_vers -productVersion

# turn firewall on
sudo defaults write /Library/Preferences/com.apple.alf globalstate -int 1
  
# update all
sudo softwareupdate -ia --verbose

# install xcode command line tool
xcode-select --install
xcode-select -p

#sudo spctl --master-disable ## you may want to reenable this option after using burp and zap for the first time -- >> sudo spctl --master-enable

# detects if Homebrew is istalled
which -s brew
if [[ $? != 0 ]] ; then
  # Install Homebrew
  /usr/bin/ruby -e "$(curl -fsSL https://raw.githubusercontent.com/Homebrew/install/master/install)"
else
  brew update
fi

# install other utilities 
#brew install git #prerequired 
brew install mas 
brew install curl
brew install tree 
brew install wget 
brew install p7zip 
brew install midnight-commander 
brew install --cask keka
brew install --cask xmind 
brew install --cask drawio
brew install --cask deluge
brew install --cask firefox
brew install --cask virtualbox 
brew install --cask sublime-text 
brew install --cask google-chrome
brew install --cask docker

#ddgo
ddgo=$(mas search duckduckgo | head -n1 | tr -s " " | cut -f2 -d" " )
mas install $ddgo  # must be sign in with Apple ID
#enpass
enpass=$(mas search enpass | head -n1 | tr -s " " | cut -f2 -d" " )
mas install $enpass

brew install python3 
brew install yarn 
git clone https://github.com/aliasio/wappalyzer
cd wappalyzer
yarn install
yarn run link
#node src/drivers/npm/cli.js https://example.com
cd

brew install --cask dotnet 
brew install --cask pycharm-ce 
brew install --cask visual-studio-code

#xcode
xcode=$(mas search xcode | head -n1 | tr -s " " | cut -f2 -d" " )
mas install $xcode

brew install --cask termius
brew install mosh 
#rdp
rdp=$(mas search microsoft-remote | head -n1 | tr -s " " | cut -f2 -d" " )
mas install $rdp

#check installs
brew doctor 

# enable terminal autocomplet 
set show-all-if-ambiguous on

#add bookmarks 
: '
sudo chmod +ux addbookmarks.sh
./addbookmarks.sh "Eclair Workstation" "HomePage https://ctinnil.github.io/Eclair/, Project https://github.com/ctinnil/Eclair, Homebrew https://formulae.brew.sh"
'

# optional, set wallpaper && user pic
img=""
echo "$img" | base64 -d > /tmp/lockscreen.jpeg
osascript -e 'tell application "Finder" to set desktop picture to POSIX file "/tmp/lockscreen.jpeg"'
